import React from 'react';
import './index.css';
import { Table, Button } from 'antd';

function TabelaHortalicas({dataSource,acoes}) {

    const columns = [
        {
            title: 'Codigo',
            dataIndex: 'key',
            key:'key',
            defaultSortOrder: 'descend',
            sorter: (a, b) => a.key - b.key,

        },
        {
            title: 'Nome',
            dataIndex: 'nome',
            key:'nome',
            defaultSortOrder: 'descend',
            sorter: ((a.nome > b.nome) ? 1 : ((b.nome > a.nome) ? -1 : 0))
        },
        {
            title: 'Categoria',
            dataIndex: 'categoria',
            key:'categoria'
        },
        {
            title: 'Classificação',
            dataIndex: 'classificacao',
            key:'classificacao'

        },
        {
            title: 'Valor',
            dataIndex: 'valor',
            key:'valor'
        },
       acoes,
    ];

    return (
        <Table dataSource={dataSource} columns={columns} className='Tabela'/>
    );
}

export default TabelaHortalicas;
